import React, { Component } from 'react'

 class testcomp extends Component {

  constructor(props) {
    super(props)
  
    this.state = {
       user: ''
    }
  }

  handleChangeUserName = (event) => {
  this.setState ({
  user: event.target.value})
}
  

  render() {
    return (
      <div>
        <form>
            <div>
                <label>UserName </label>
                <input type='text' value={this.state.user} onChange={this.handleChangeUserName}></input>
            </div>
            <div>
                <label>Comments</label>
                <textarea></textarea>
            </div>
            <div>
                <select></select>
            </div>
        </form>
      </div>
    )
  }
}

export default testcomp
